import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Your automation logic here
    // First, perform a search to make the view toggle buttons appear
    await page.locator('#searchInput').fill('electronics');
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_search_filled.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_search_filled.png'));

    // Click the search button next to the input
    await page.locator('input.search-input + button.search-btn').click();

    // Wait for the search results and view toggle controls to be visible
    await page.waitForSelector('.sort-filter-controls', { timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_grid_view_results.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_grid_view_results.png'));

    // Locate and click the "List View" button using its title attribute
    const listViewButton = page.locator('button[title="List View"]');
    await listViewButton.waitFor({ state: 'visible', timeout: 5000 });
    await listViewButton.click();

    // Wait for the product container to switch to the 'products-list' class
    await page.waitForSelector('.products-list', { timeout: 5000 });
    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_list_view_active.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_list_view_active.png'));

    // Extract data to verify the view has changed
    const productContainer = await page.locator('.products-list');
    const isListViewVisible = await productContainer.isVisible();
    const containerClass = await productContainer.getAttribute('class');

    return {
      success: true,
      action: "Switched to List View Mode",
      extractedData: {
        isListViewVisible: isListViewVisible,
        productContainerClass: containerClass
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to switch to List View Mode",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
